import React from 'react';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

const Nav = () => {
    return (
        <Router>
             <Switch>
                <Route path="/todolist" component={ToDo}></Route>
            </Switch>
        </Router>
    );
}

export default Nav;
